import React from 'react';
import { IonItem, IonLabel } from '@ionic/react';
import { StockProps } from './StockProps';

interface StockPropsExt extends StockProps {
  onEdit: (id?: string) => void;
}

const Stock: React.FC<StockPropsExt> = ({ id, name, price, available, onEdit }) => {
  return (
    <IonItem onClick={() => onEdit(id)}>
      <IonLabel>Name: {name}, Price: ${price}, Available: {available ? "true" : "false"}</IonLabel>
    </IonItem>
  );
};

export default Stock;
